html.script:
  let svgNS = {
  svg: "http://www.w3.org/2000/svg",
  xlink: "http://www.w3.org/1999/xlink",
};
let ns = {
  svg: "http://www.w3.org/2000/svg",
  xlink: "http://www.w3.org/1999/xlink",
};

paisley = function () {
  makeCircleFromClass(
    2,
    1600,
    "canvas",
    document.getElementsByClassName("paisleyLeaf")
  );
  gsap.set("#canvas", { scale: 0.5, x: -1600, y: -1400 });
  gsap.to("#canvas", 300, {
    transformOrigin: "center",
    rotate: "-360",
    ease: Linear.easeNone,
    repeat: -1,
  });
  makeCirclesWingZebraFlame();
};

makeCircleFromObject = function (cuts, radius, groupName, useTarget) {
  //either make a create group function which adds the group into the svg or
  //get rid of the group that this function adds and just add stuff to pre made groups
  //as it is now is wrong

  let group = document.createElementNS(svgNS.svg, "g");
  // svgContainer.appendChild(group);
  document.querySelector(`#${groupName}`).appendChild(group);
  for (let i = 1; i <= cuts; i++) {
    let use = document.createElementNS(svgNS.svg, "use");
    let angleDeg = (360 * i) / cuts;
    let angleRad = (2 * Math.PI * i) / cuts;

    use.setAttributeNS(svgNS.xlink, "href", `#${useTarget}`);
    gsap.to(use, 2, {
      transformOrigin: "center",
      x: `+=${radius * Math.sin(angleRad)}`,
      y: `-=${radius * Math.cos(angleRad)}`,
      rotation: angleDeg,
    });
    group.appendChild(use);
  }
};
makeCircleFromClass = function (cuts, radius, groupName, useClass) {
  let classSize = useClass.length;
  let totalCuts = cuts * classSize;
  let group = document.createElementNS(ns.svg, "g");
  document.querySelector(`#${groupName}`).appendChild(group);

  for (let i = 1; i <= totalCuts; i++) {
    let use = document.createElementNS(ns.svg, "use");
    let angleDeg = (360 * i) / totalCuts;
    let angleRad = (2 * Math.PI * i) / totalCuts;

    use.setAttributeNS(
      ns.xlink,
      "href",
      `#${useClass[(i - 1) % classSize].id}`
    );
    gsap.to(use, 2, {
      transformOrigin: "center",
      x: `+=${radius * Math.sin(angleRad)}`,
      y: `-=${radius * Math.cos(angleRad)}`,
      rotation: angleDeg,
    });
    group.appendChild(use);
  }
};

makeCirclesWingZebraFlame = function () {
  //paisleyWing
  makeCircleFromObject(3, 2000, "wingGroup", "paisleyWing");
  gsap.set("#wingGroup", {
    transformOrigin: "center",
    x: 700,
    y: 200,
    scale: 0.6,
  });
  gsap.to("#wingGroup", 480, {
    transformOrigin: "center",
    rotate: "-360",
    ease: Linear.easeNone,
    repeat: -1,
  });

  //paisleyFlame
  makeCircleFromObject(6, 2000, "flameGroup", "paisleyFlame");
  gsap.set("#flameGroup", { transformOrigin: "center", x: 700, y: 700 });
  gsap.to("#flameGroup", 240, {
    transformOrigin: "center",
    rotate: "360",
    ease: Linear.easeNone,
    repeat: -1,
  });

  //paisleyZebra
  makeCircleFromObject(5, 2000, "zebraGroup", "paisleyZebra");
  gsap.set("#zebraGroup", { transformOrigin: "center", x: 500, y: 500 });
  gsap.to("#zebraGroup", 360, {
    transformOrigin: "center",
    rotate: "360",
    ease: Linear.easeNone,
    repeat: -1,
  });
};
paisley();
